import { ReactComponentElement as ShoppingIcon } from '../../assets/shopping-bag.svg';

import './card-icon.styles.scss';

const CartIcon = () => {

  return(
    <div className='cart-icon-container'>
     <ShoppingIcon className='shopping-icon'/>
     <span>0</span>
    </div>
  )

}

export default CartIcon;
